import React from 'react'

function SecondaryButton(props) {
  return (
    <>
      <button style={{backgroundColor:"rgba(255,255,255,0)", color:"white", border:"2px solid #ff751f", color:"#ff751f",padding:".5em 1em .5em 1em", fontWeight:"550"}}>
        {props.text}
      </button>
    </>
  )
}

export default SecondaryButton
